import './App.css';
import NavBar from './components/NavBar/NavBar';
import Categories from './components/Categories/Categories'
import { BrowserRouter as Router, Route } from 'react-router-dom';
function App() {
  return (
    <Router>
      <div className="App">
        <NavBar />
        <Categories/>
        <Route exact path="/" component={Home} />
      </div>
    </Router>
  );

}

export default App;
